import React from 'react';
import {BrowserRouter, Switch, Router, Link, Route} from "react-router-dom"
import Home from "./routes/Home"
import Registry from "./routes/Registry"
import './App.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
       <Switch>
         <Route path="/" exact>
           <Hpme />
         </Route>
         <Route path="/registry">
          <Registry />
         </Route>
       </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
